### Problem12


Is the following class immutable?
```java
import java.util.Date;
public class Appointment
{
    private Date date;
    private String contact;
    public Appointment(Date date)
    {
        this.date = date;
        this.contact = contact;
    }
    public Date getDate()
    { 
        return date; 
    }
}
```
Answer: _____(0)\___ (Yes or No).
